INSERT INTO "trnpost" VALUES (15,5,'what is the best way to handle heavy reads on one Table','i have a multi vendor e-commerce website, and each product has its views stored. Each record represents 1 unique visit, and so on

expected to have at least 1000 views per product and will have 100+ product

every vendor will have access to analytics, like product views in the last 30 days , week , today , etc

caching these results, in my opinion, will consume a lot of disk space,

so i thought whenever i recorded a new visit in the views table, i increment a column "total views" in the product table

will count the total but not in month or week or day and all other possibilities

what is the best approach i can do in this situation ?',NULL,'Kelsey Lawson','Kelsey Lawson','2022-12-13 16:37:55.89879','2022-12-13 16:37:55.89879');
INSERT INTO "trnpost" VALUES (16,5,'Package to speed up api development','Does anyone know of a package that has a similar developer experience to Nova and Filament where you define your models/resources and the routes, validation and crud operations get created?

UPDATE - Thanks for initial suggestions but I am not looking for an admin panel or code generation. I have a current app with 100+ models and a lot of these are relatively simple objects but i have to create 3-4 files per each. I really like how Nova directs all traffic to /nova/resources/{resource}/{resourceId?} etc.. and then resolves the resource back to a class so was just wondering if there is a similar package/library that exists.

ANOTHER UPDATE - I''ve mocked up a simple example of how this might work as per below. If there aren''t any packages like this I might take this further.',NULL,'Kelsey Lawson','Kelsey Lawson','2023-04-08 09:47:12.916287','2023-04-08 09:47:12.916287');
INSERT INTO "trnpost" VALUES (17,5,'From Freelancer Job Post to Web App: A Step-by-Step Guide Using Laravel','Hey everyone,

I am excited to announce that we are starting a new project on our YouTube channel where we will be building a web application using Laravel from scratch. This project was originally posted on Freelancer.com with a budget of approx $2000/-.

Our team will be documenting the entire process and sharing valuable insights and tips along the way to help you become a successful freelancer. We will be covering various components of the Laravel framework, including routes, controllers, views, and migrations.

In addition to the development process, we will also be sharing details about the original Freelancer.com job post, discussing what the client was looking for, and how we approached the project.

Join us for this exciting journey and learn how to build a web app from scratch while also gaining valuable insights into successful freelancing. Don''t forget to hit the subscribe button and turn on the notification bell to stay updated with our latest content.

See you on our channel!

Here is the link to Web App Intro -',NULL,'Kelsey Lawson','Kelsey Lawson','2023-04-15 09:47:12.916287','2023-04-15 09:47:12.916287');
INSERT INTO "trnpost" VALUES (18,5,'Introduction to Laravel PHP Framework','Laravel is a free, open-source PHP web application framework designed to make building web applications easier and more efficient. It was created by Taylor Otwell in 2011 and has since become one of the most popular PHP frameworks available. Laravel follows the Model-View-Controller (MVC) architectural pattern and provides a wide range of features and tools to help developers build scalable and maintainable web applications. Some of the key features of Laravel include its elegant syntax, powerful routing system, built-in authentication and authorization mechanisms, and a vast library of pre-built components and packages. With its intuitive design and comprehensive documentation, Laravel has become a top choice for developers looking to streamline their development process and build high-quality web applications.',NULL,'Kelsey Lawson','Kelsey Lawson','2023-04-16 16:14:13.264682','2023-04-16 16:14:13.264682');
